    static Dictionary<string, List<double>> cityDictionary = new Dictionary<string, List<double>>();
    static double[][] jagged_array_city = new double[81][];
    static double[,] city_matrix_81_81 = new double[81, 81];

    static Dictionary<string, List<double>> districtDictionary = new Dictionary<string, List<double>>();
    static double[,] array_district = new double[30,30];
    static double[,] district_matrix_neighbor = new double[30, 30];

    static void Main()
    {
        fillCityDictionary();
        AddListsToMatrixDouble(city_matrix_81_81, cityDictionary);
        readFile("sehirmesafe.txt", jagged_array_city,null);
        PrintDistances(cityDictionary, city_matrix_81_81, jagged_array_city,null ,81);


        fillDistrictDictionary();
        AddListsToMatrixDouble(district_matrix_neighbor, districtDictionary);
        readFile("ilcemesafe.txt", null,array_district);
        PrintDistances(districtDictionary, district_matrix_neighbor, null, array_district, 30);

    }


    static void PrintDistances(Dictionary<string, List<double>> dictionary, double[,] matrix, double[][] jaggedArray, double[,] array_district, int numberOfCities)
    {
        double minDifference = double.MaxValue, maxDifference = double.MinValue;
        double highwaysDistance = 0;
        double dijkstraDistance = 0;
        String minDiffCity1 = "", minDiffCity2 = "", maxDiffCity1 = "", maxDiffCity2 = "";
        List<String[]> minCity = new List<String[]> { };
        for (int i = 0; i < matrix.GetLength(0); i++)
        {
            double[] distances = ApplyDijkstra(matrix, i, numberOfCities);
            for (int j = 0; j < matrix.GetLength(0); j++)
            {
                if (matrix[i, j] == 10000 && i != j)
                {
                    Console.WriteLine(dictionary.ElementAt(i).Key + " - " + dictionary.ElementAt(j).Key + " : " + distances[j] + " KM (Dijkstra Algorithm)");
                    if (array_district==null)
                    {
                        if (i > j)
                        {
                            highwaysDistance = jaggedArray[i][j];
                            Console.WriteLine("" + dictionary.ElementAt(i).Key + " - " + dictionary.ElementAt(j).Key + " : " + jaggedArray[i][j] + " KM (General Directorate of Highways)");
                        }
                        else
                        {
                            highwaysDistance = jaggedArray[j][i];
                            Console.WriteLine("" + dictionary.ElementAt(i).Key + " - " + dictionary.ElementAt(j).Key + " : " + jaggedArray[j][i] + " KM (General Directorate of Highways)");
                        }
                    }
                    else
                    {
                        highwaysDistance = array_district[i,j];
                        Console.WriteLine("" + dictionary.ElementAt(i).Key + " - " + dictionary.ElementAt(j).Key + " : " + array_district[i, j] + " KM (General Directorate of Highways)");
                    }
                    

                    dijkstraDistance = distances[j];
                    Console.WriteLine($"Difference Between Dijkstra Algorithm And General Directorate of Highways: {dijkstraDistance - highwaysDistance}KM\n");
                }

                if (Math.Abs(dijkstraDistance - highwaysDistance) <= minDifference && i != j && matrix[i, j] == 10000.0)
                {
                    String[] city = new string[2];
                    if (Math.Abs(dijkstraDistance - highwaysDistance) < minDifference)
                    {
                        minCity.Clear();
                    }
                    minDifference = Math.Abs(dijkstraDistance - highwaysDistance);
                    minDiffCity1 = dictionary.ElementAt(i).Key;
                    minDiffCity2 = dictionary.ElementAt(j).Key;
                    city[0] = minDiffCity1;
                    city[1] = minDiffCity2;
                    Array.Sort(city);
                    bool check = true;
                    foreach (string[] array in minCity)
                    {
                        if (array.SequenceEqual(city))
                        {
                            check = false;
                        }
                    }
                    if (check)
                    {
                        minCity.Add(city);
                    }

                }
                if (dijkstraDistance - highwaysDistance > maxDifference)
                {
                    maxDifference = dijkstraDistance - highwaysDistance;
                    maxDiffCity1 = dictionary.ElementAt(i).Key;
                    maxDiffCity2 = dictionary.ElementAt(j).Key;
                }

            }
            Console.WriteLine();
        }
        Console.WriteLine($"Maximum Difference: {maxDifference}KM, Cities: {maxDiffCity1},{maxDiffCity2}\nMinimum Difference: {minDifference}KM, Cities: ");
        foreach (var i in minCity)
        {
            foreach (var j in i)
            {
                Console.Write(j + " ");
            }
            Console.WriteLine();
        }
    }

    static double[] ApplyDijkstra(double[,] matrix, int startingCity, int numberOfCities)
    {
        double[] shortestDistances = new double[numberOfCities];
        bool[] isVisited = new bool[numberOfCities];

        for (int i = 0; i < numberOfCities; i++)
        {
            shortestDistances[i] = double.MaxValue;
            isVisited[i] = false;
        }

        shortestDistances[startingCity] = 0;

        var list = new List<(double distance, int city)>();

        list.Add((0, startingCity));

        while (list.Count > 0)
        {
            list.Sort((a, b) => a.distance.CompareTo(b.distance));
            var current = list[0];
            list.RemoveAt(0);

            int currentCity = current.city;
            if (isVisited[currentCity]) continue;

            isVisited[currentCity] = true;

            for (int i = 0; i < numberOfCities; i++)
            {
                if (matrix[currentCity, i] != 10000.0 && currentCity != i)
                {
                    double distance = matrix[currentCity, i];
                    double newDistance = shortestDistances[currentCity] + distance;

                    if (newDistance < shortestDistances[i])
                    {
                        shortestDistances[i] = newDistance;
                        list.Add((newDistance, i));
                    }
                }
            }
        }
        return shortestDistances;
    }


