    static void AddListsToMatrixDouble(double[,] matrix, Dictionary<string, List<double>> dictionary)
    {
        int row = 0;
        foreach (var cityData in dictionary.Values)
        {
            for (int col = 0; col < cityData.Count && col < 81; col++)
            {
                matrix[row, col] = cityData[col];
            }

            row++;
            if (row >= 81) break;
        }
    }

    static void readFile(string filePath, double[][] jaggedArray, double[,] array)
    {

        int index = 0;
        
        foreach (var line in File.ReadLines(filePath))
        {
            if (string.IsNullOrWhiteSpace(line))
                continue;
            if (array == null)
            {
                List<double> list = new List<double> { };
                foreach (string number in line.Split(','))
                {
                    list.Add(double.Parse(number));
                }
                jaggedArray[index] = new double[list.Count];
                jaggedArray[index] = list.ToArray();
                index++;
            }
            else
            {
                int index2 = 0;
                foreach (string number in line.Split(','))
                {
                    array[index, index2] = double.Parse(number, CultureInfo.InvariantCulture);
                    index2++;
                }
                index++;
            }
            
            
        }
    }
